import React from 'react'
import Card from 'react-bootstrap/Card'
import engineering from '../assets/images/engineering.png'


function Crd(props){
    return(
        <Card className = "crd-style p-4" style={{border: 'none'}}>
            <Card.Img style={{
                width: '50 %',
                height: 'auto',
                marginLeft: 'auto',
                marginRight: 'auto',
                boxShadow: '0px 0px 3px 1px #CCC' }} variant="top" src={engineering} />
            <Card.Body>
            <Card.Title>{props.title}</Card.Title>
            <p>{props.company}</p>
            <small>{props.time}</small>
            <br/>
            <br/>
            <Card.Text>
                {props.text}
            </Card.Text>
            </Card.Body>
        </Card>
    );
}

export default Crd;
